import React from "react";
import { Table, Button, Container } from "react-bootstrap";

const Offres = () => {
  const offers = [
    { id: 1, name: "A Vendre" },
    { id: 2, name: "A Louer" },
  ];

  return (
    <Container>
      <div className="py-4">
        <Table bordered hover className="center">
          <thead>
            <button>Ajouter Ofrre</button>
            <tr>
              <th>Id</th>
              <th>Nom Offre</th>
              <th>Action</th>
            </tr>
          </thead>
          <tbody>
            {offers.map((offer) => (
              <tr key={offer.id}>
                <th scope="row">{offer.id}</th>
                <td>{offer.name}</td>
                <td>
                  <Button variant="danger" className="mx-2 displey">
                    Delete
                  </Button>
                </td>
              </tr>
            ))}
          </tbody>
        </Table>
      </div>
    </Container>
  );
};

export default Offres;
